INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, 1.5, 105, 0, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 160, 1, 0, 101, 0.029, 122601, 1, 1, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (2, 2.5, 111, 0, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 120, 3, 1, 102, 0.014, 122401, 2, 0, 105);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (3, 2.5, 105, 1, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 350, 2, 0, 103, 0.017, 122501, 3, 0, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (4, 1.5, 105, 0, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 130, 3, 1, 104, 0.016, 107501, 4, 0, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (5, 2.5, 105, 0, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 160, 1, 0, 105, 0.014, 107601, 5, 1, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (6, 3.5, 103, 1, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 255, 2, 0, 106, 0.029, 107801, 6, 0, 120);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (7, 3.5, 103, 0, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 160, 1, 0, 107, 0.013, 110601, 7, 1, 120);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (8, 2.5, 103, 1, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 350, 2, 0, 108, 0.014, 110401, 8, 0, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (9, 1.5, 100, 0, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 130, 3, 1, 109, 0.012, 110501, 9, 0, 105);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (10, 2.5, 103, 0, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 200, 1, 0, 110, 0.014, 115701, 10, 1, 105);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (11, 2.5, 103, 1, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 350, 2, 0, 111, 0.071, 113601, 11, 0, 105);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (12, 1.5, 103, 0, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 130, 3, 1, 112, 0.014, 107901, 12, 0, 120);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (13, 1.5, 105, 0, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 200, 2, 0, 113, 0.022, 108001, 13, 1, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (14, 2.5, 108, 0, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 160, 1, 0, 114, 0.031, 110301, 14, 1, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (15, 0.5, 105, 0, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 130, 1, 1, 115, 0.036, 107701, 15, 0, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (16, 3.5, 95, 1, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 350, 2, 0, 116, 0.048, 113101, 16, 0, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (17, 1.5, 105, 0, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 130, 3, 1, 117, 0.043, 113301, 17, 0, 105);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (18, 1.5, 95, 0, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 130, 2, 1, 118, 0.018, 113201, 18, 0, 105);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (19, 2.5, 108, 0, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 160, 2, 0, 119, 0.021, 117001, 19, 1, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (20, 2.5, 105, 1, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 255, 1, 0, 120, 0.036, 113501, 20, 0, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (21, 2.5, 105, 1, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 350, 3, 0, 121, 0.02, 113401, 21, 0, 105);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (22, 2.5, 105, 0, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 130, 1, 1, 122, 0.018, 110101, 22, 0, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (23, 3.5, 111, 0, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 160, 3, 0, 123, 0.03, 110001, 23, 1, 105);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (24, 1.5, 103, 0, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 130, 1, 1, 124, 0.027, 117201, 24, 0, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (25, 3.5, 108, 0, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 160, 2, 0, 125, 0.02, 117301, 25, 1, 105);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (26, 2.5, 105, 1, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 350, 3, 0, 126, 0.04, 117401, 26, 0, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (27, 3.5, 105, 1, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 350, 1, 0, 127, 0.009, 117101, 27, 0, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (28, 3.5, 105, 1, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 255, 1, 0, 128, 0.022, 122901, 28, 0, 120);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (29, 2.5, 105, 0, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 130, 3, 1, 129, 0.028, 122801, 29, 0, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (30, 3.5, 108, 0, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 130, 2, 0, 130, 0.023, 122701, 30, 1, 105);
